def print_ugrid_points_and_cells(ugrid, count=5):
    """
    Print the first n ugrid points and cells, where n is count.
    
    Args:
        ugrid (UGrid): a grid with points and cells
        count (int): number of points and cells to print
    """
    points = ugrid.get_locations()
    cells = ugrid.get_cellstream()
    # Print the first few points and cells that were loaded
    if count > len(points):
      print("Number of points specified is greater than number of points available. Printing all points...")
    print('First {} points:'.format(count))
    for i in range(0, count):
        print('Point {0}:  {1}'.format(i, points[i]))

    if count > len(cells):
      print("Number of cells specified is greater than number of points available. Printing all cells...")
    print('\n\nFirst {} cells:'.format(count))
    for i in range(0, count):
        msg = 'Cell {}:  '.format(i)
        if (cells[i*5]) == 5:
            msg = msg + 'Cell Type:  Triangle, '
        elif (cells[i*5]) == 9:
            msg = msg + 'Cell Type:  Quad, '
        msg = msg + '{} points:  '.format(cells[i*5 + 1])
        msg = msg + '('
        for j in range(0, cells[i*5 + 1]):
            msg = msg + '{}'.format(cells[i*5 + 2 + j])
            if (j < cells[i*5 + 1] - 1):
                msg = msg + ', '
        msg = msg + ')'
        print(msg)
        
        
def create_hv_objects_for_image(_ug, _projection=None):
    """
    Get the holoviews objects from a ugrid to be able to display
    
    Args:
        _ug (UGrid): a grid with points and cells
        
    Returns:
        holoviews.Polygons: polygons to display
        holoviews.Path: lines to display
        holoviews.Points: points to display
    """
    points = _ug.get_locations()
    cell_stream = _ug.get_cellstream()

    cellstream_index = 0
    
    # Parse Stream
    polygons = []
    lines = []
    while cellstream_index < len(cell_stream):
        cell_type = cell_stream[cellstream_index]
        point_count = cell_stream[cellstream_index + 1]
        cell_point_indexs = [cell_stream[x] for x in range(cellstream_index + 2, cellstream_index + 2 +  point_count)]
        cell_points = [points[x] for x in cell_point_indexs]
        if cell_type not in [xmsgrid.ugrid.UGrid.POLY_LINE, xmsgrid.ugrid.UGrid.LINE]:
            if cell_type == xmsgrid.ugrid.UGrid.PIXEL:
                i3 = cell_points[2]
                cell_points[2] = cell_points[3]
                cell_points[3] = i3
            poly = Polygon(cell_points)
            polygons.append(poly)
        else:
            lines.append(cell_points)
        cellstream_index += (2 + point_count)
         
    if not _projection:
      # Polygons
      r_polygons = hv.Polygons(polygons)
              
      # Lines
      r_lines = hv.Path(lines).options(line_color='red')
      
      # Points
      r_points = hv.Points(points).options(color='black', size=1.5)

    else:
      # Polygons
      r_polygons = gv.Polygons(polygons, crs=_projection)
              
      # Lines
      r_lines = gv.Path(lines, crs=_projection).options(line_color='red')
      
      # Points
      r_points = gv.Points(points, crs=_projection).options(color='black', size=1.5)
      
      
    return r_polygons, r_lines, r_points

